import Modal from 'react-bootstrap/Modal';
import Button from 'react-bootstrap/Button';

const AddAccount = (props) => {

    const {show, handleClose, handleAddNewAccount} = props

    const handleSaveAccount = async () => {
        // let res = await addNewAccount(userData)
        // if (res && res.id) {
        //     handleClose()
        //     setUserData('')
        //     toast.success("Create new account successful!!!")
        //     handleAddNewAccount({userData})
        // }else{
        //     toast.error("Fail to create new account")
        // }
    }

    return(
        <Modal show={show} onHide={handleClose}>
            <Modal.Header closeButton>
            <Modal.Title>New Event</Modal.Title>
            </Modal.Header>
            <Modal.Body>
                <div className="body-add">
                <div className="mb-3">
                        <label className="form-label">First Name</label>
                        <input type="text" className="form-control"/>
                    </div>
                    <div className="mb-3">
                        <label className="form-label">Last Name</label>
                        <input type="text" className="form-control"/>
                    </div>
                    <div className="mb-3">
                        <label className="form-label">Email</label>
                        <input type="text" className="form-control"/>
                    </div>
                    <div className="mb-3">
                        <label className="form-label">Deadline of event</label>
                        <input type="text" className="form-control"/>
                    </div>
                </div>
            </Modal.Body>
            <Modal.Footer>
            <Button variant="secondary" onClick={handleClose}>
                Close
            </Button>
            <Button variant="primary" onClick={() => handleSaveAccount()}>
                Save
            </Button>
            </Modal.Footer>
        </Modal>
    )
}

export default AddAccount
